  return (
    <div>
      <table>
        <tbody>
          {dummy.PostList.map( data => (
            <tr>
              <td><form onSubmit={deletePostPage}><button>삭제</button></form></td>
              <td><form onSubmit={goPostPage}><button>내용</button> ///// </form></td>
              <td>{data.Day} ///// </td>
              <td>{data.Title} ///// </td>
            </tr>
          ))}
        </tbody>
      </table>  
    </div>
  );

  function goPostPage(e)
  {
    e.preventDefault();

  }

  function deletePostPage(e)
  {
    e.preventDefault();
  }
}

